import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class RenderDOM extends Component {
    Change(){
        var container = document.getElementById("myId");
        var element = <h2> Pro Developer Sobuj </h2>;
        var callback = function(){
            alert("Progrommer Green now Pro Developer Sobuj");
        }

        ReactDOM.render(element, container, callback);
    }
    render() {
        return (
            <div className="mt-5 text-center">

                <h1 className="DomProColor"> React Dom Project  </h1>
                <h2 className="DomColor">render DOM</h2>
                <p> render() -> ReactDOM.render( element, container[, callback] ) </p>
                <button className="btn-danger mt-2" onClick={ this.Change }> change name </button>
                <h2 id="myId"> progrommer green </h2>
            </div>
        )
    }
}
export default RenderDOM
